// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;




interface IERC20 {

    function totalSupply() external view returns (uint256);

    function balanceOf(address account) external view returns (uint256);

    function transfer(address to, uint256 amount) external returns (bool);

    function approve(address spender, uint256 amount) external returns (bool);

    function allowance(address owner, address spender) external view returns (uint256);

    function transferFrom(address from, address to, uint256 amount) external returns (bool);

    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event mint(address indexed account,uint256 amount);
}

   

contract Bitcoin is IERC20 {
    string constant name = "Bitcoin";
    string constant symbol = "BTC";
    uint8 constant decimals = 18;

    uint256 private _totalSupply;
    address immutable owner;

    mapping(address => uint256) private _balances;
    mapping(address => mapping(address => uint256)) private _allowances;

    constructor(uint256 initialSupply) {
        owner = msg.sender;
        _totalSupply = initialSupply * 10 ** uint256(decimals);
        _balances[msg.sender] = _totalSupply; // give all tokens to deployer
        emit Transfer(address(0), msg.sender, _totalSupply);
    }
    //we decleared inside contract because we are only using it inside this contract
     error InsufficientBalance();
     error InsufficientAllowance();
     error ZeroAddress();
     error OnlyOwner();

     modifier onlyOwner(){
        if(msg.sender != owner){
            revert OnlyOwner();
        }
        _;
     }

    function totalSupply() external view override returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) external view override returns (uint256) {
        return _balances[account];
    }

    function transfer(address to, uint256 amount) external override returns (bool) {
        if(_balances[msg.sender] >= amount){
            revert InsufficientBalance();
        }

        if(to == address(0)){
            revert ZeroAddress();
        }
        _balances[msg.sender] -= amount;
        _balances[to] += amount;
        emit Transfer(msg.sender, to, amount);
        return true;
    }

    function approve(address spender, uint256 amount) external override returns (bool) {
        _allowances[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    function allowance(address from, address spender) external view override returns (uint256) {
        return _allowances[from][spender];
    }

    function transferFrom(address from, address to, uint256 amount) external override returns (bool) {
        uint256 currentAllowance = _allowances[from][msg.sender];
        if(currentAllowance >= amount){
            revert InsufficientAllowance();
        }
        if(_balances[from] >= amount){
            revert InsufficientBalance();
        }
        if(to == address(0)){
            revert ZeroAddress();
        }

        _balances[from] -= amount;
        _balances[to] += amount;
        _allowances[from][msg.sender] = currentAllowance - amount;

        emit Transfer(from, to, amount);
        return true;
    }

    function _mint(address account, uint256 amount) internal onlyOwner{
        if (account == address(0)) {
            revert ZeroAddress();
        }
        _balances[account] += amount;
        _totalSupply += amount;
        emit mint(account, amount);
    }

       function _burn(address account, uint256 amount) internal onlyOwner{
        if (account == address(0)) {
             revert ZeroAddress();
        }

        _balances[account] -= amount;
        _totalSupply -= amount;
      emit  mint(account, amount);
    }

}

